import React,{Component} from 'react';
import Eos from 'eosjs';
import WalletGraph from './components/graph';
import TransferButton from './components/transferButton';
import TransferButton2 from './components/transferButton2';
import Transactions from './components/transactions';
import Typography from '@material-ui/core/Typography';
import history from './../../history'

let user = history.location.pathname.split("/")[2];
let eosConfig = {
  httpEndpoint: 'http://ec2-34-227-77-165.compute-1.amazonaws.com:8888',
}
let eos = Eos(eosConfig);

function fl(time,amount){
  let n=[]
  for(let i=0;i<time.length;i++){
    let t = time[i]
    let a = amount[i]
    let obj = {x:t,y:a}
    n.push(obj);
  }
  return n;
}
const e = async () => {return await eos.getTableRows(true,"records",user,"payments")
  .then(rows=>{return rows.rows})}
  //let a =e();
  //console.log("A",a);
  let updatedData =(data,labels)=>{
    return {
      labels: labels,
      datasets: [{
        label: "My First dataset",
        fillColor: "rgba(220,220,220,0.2)",
        strokeColor: "rgba(220,220,220,1)",
        pointColor: "rgba(220,220,220,1)",
        pointStrokeColor: "#fff",
        pointHighlightFill: "#fff",
        pointHighlightStroke: "rgba(220,220,220,1)",
        data:data,
        sum:0
      }]}
    }
    class Wallet extends Component{
      constructor(props){
        super(props);
        this.state = {
          legend:[],
          dataArr:[],
          arr:[],
          narr:[],
          max:0,
          data :[],
          update: false,
          totalBalance: 0,
        }
        this.handleSubmit=this.handleSubmit.bind(this);
      }

      async componentDidMount(){
        //console.log()
        let a = await e();
        //console.log(a);
        let t = a.map(id=>{return id.time.toString()})
        let d = a.map(id=>{return parseInt(id.amount.split(" ")[0])})
        if(t.length===0){
          t = [0];
          d=[0];
          a=[0];
        }
        //console.log("t",t,"d",d);
        //options.scales.yAxes.push({ticks:{suggestedMin:0,suggestedMax:Math.max(...d)}})
        //options.scales.xAxes.push({ticks:{suggestedMin:Math.min(...t),suggestedMax:Math.max(...t)+20}})
        let n=fl(t,d)
        let datat = updatedData(d,t);
        let sum =d.reduce(function(a, b) { return a + b; }, 0);
        this.setState({arr:a,legend:t,data:datat,narr:n,sum:sum});

      }
      handleSubmit(PrivateKey,TargetAddress,amount){
        let keyProvider= PrivateKey
        let eos2=Eos({keyProvider});
        amount = amount.toString()+" "+"SYS";
        eos2.transfer(this.props.match.params.user,TargetAddress,amount,'').then((err,res)=>{
          if(!err) {alert("ERROR TRANSFER");console.log(err);}
          else alert(`SENT TRANSACTION TO ${TargetAddress}`);
        });
      }
      render(){
        console.log("Datar32sdfsender",this.state.data)
        if(this.state.arr.length===0){
          return(<div><p>Loading</p></div>);
        }
        else if(this.state.arr[0]===0){
          return(
            <div className="WalletPage">
              <div className="Header">
                <div className="Top">
                  <Typography variant="display3">Wallet</Typography>
                  <TransferButton2 disabled={true}/>
                </div>
                <WalletGraph data={this.state.data}/>
              </div>
              <div className="Balance">
                <Typography variant="display2">Balance:</Typography>
                <Typography variant="display2">{this.state.sum}&nbsp;SRC</Typography>
              </div>
              <div className="Transactions">
                <Typography variant="display2">Transactions</Typography>
                <div className="History">
                  <Typography variant="caption">From/To</Typography>
                  <Typography variant="caption">Amount</Typography>
                </div>
              </div>
            </div>
          )
        }
        else return(
          <div className="WalletPage" style={{display:"flex", justifyContent:"center", paddingTop:"50px", paddingBottom:"50px"}}>
            <div style={{width:"900px", backgroundColor:"white", boxShadow:"0 0 30px #f2f2f2"}}>
              <div style={{padding:"20px", paddingLeft:"30px", paddingRight:"30px"}}>
                <h2>Daily Income</h2>
                <div style={{display:"flex"}}>
                  <WalletGraph data={this.state.data}/>
                  <TransferButton handleSubmit={this.handleSubmit}/>
                </div>
              </div>
              <div style={{display:"flex", justifyContent:"space-between", alignItems:"center", paddingLeft:"30px", paddingRight:"30px", backgroundColor:"#f7f7f7", paddingTop:"10px", paddingBottom:"10px"}}>
                <h2>Balance:</h2>
                <h3>{this.state.sum}&nbsp;SRC</h3>
              </div>
              <div style={{paddingLeft:"30px", paddingRight:"30px", paddingBottom:"30px"}}>
                <h1>Transactions</h1>
                <div>
                  <div style={{display:"flex", justifyContent:"space-between"}}>
                    <p>From/To</p>
                    <p>Amount</p>
                  </div>
                  <Transactions data={this.state.arr}/>
                </div>
              </div>
            </div>
          </div>
        )
      }
    }
    export default Wallet;
